column24:
Data is partially available: train, tramway and plane schedules are posted on the official website of the respective websites (http://www.tram-way.ma/fr/ ; http://www.casatramway.ma/ ; http://www.onda.ma/ ; http://www.oncf.ma/Pages/Accueil.aspx ;
http://www.ctm.ma/). Data is not provided at all. The visitor can only send queries through a web interface. Each website (thus, institution) has its own copyright on each website.

Regarding whether information is provided on a timely and up-to-date basis: One would imagine so as these are frequently used services. Yet no indication is available to inform on when the last update was done.
